info:

Eli (Denzel Washington) has been on a journey for 30 years, walking west across America after a cataclysmic war that turned the earth into a total wasteland. The world has become a lawless civilization where people must kill or be killed. The barren roads belong to gangs of cutthroats who rob and kill for water, a pair of shoes, a lighter, or just for fun. Eli is a peaceful man who only acts in self defense, and becomes a warrior with unbelievable killing skills when he is challenged. After the war and the &quot;Big Flash&quot;, Eli was guided by a higher power to a hidden book and given the task of protecting the book and taking it to its final destination. Eli guards the book with his life, because he knows that the book is the only hope that humanity has for its future. 

